INSERT INTO `books` VALUES (12,'2021-10-27 12:45:25',_binary '\0','2021-10-27 12:45:25','	0-399-22690-7','Eric Carle','The Very Hungry Catapillar',_binary 'data:image/jpeg;base64,','1969-06-03 10:00:00','World Publishing Company','- Day 1\n- Day 2\n- Day 3\n- Day 4\n- Day 5','Childrens'),(13,'2021-10-27 01:48:33',_binary '\0','2021-10-27 01:48:33','21212342336','Christopher Paolini','Eragon 1',_binary 'data:image/png;base64,','2014-06-19 00:00:00','cbj','Eragon is the first book in The Inheritance Cycle by American fantasy writer Christopher Paolini. Paolini, born in 1983, began writing the novel after graduating from high school at age fifteen. After writing the first draft for a year, Paolini spent a second year rewriting and fleshing out the story and characters. His parents saw the final manuscript and in 2001 decided to self-publish Eragon; Paolini spent a year traveling around the United States promoting the novel. The book was discovered by novelist Carl Hiaasen, who got it re-published by Alfred A. Knopf. The re-published version was released on August 26, 2003.\n\nThe book tells the story of a farm boy named Eragon, who finds a mysterious stone in the mountains. The stone is revealed to be a dragon egg, and a dragon he later names Saphira hatches from it. When the evil King Galbatorix finds out about the egg, he sends monstrous servants to acquire it, making Eragon and Saphira flee from their hometown with a storyteller named Brom. Brom, an old member of an extinct group called the Dragon Riders, teaches Eragon about \'The Ways of the Rider.\'\n\nEragon was the third-best-selling children\'s hardback book of 2003, and the second-best-selling paperback of 2005. It placed on the New York Times Children\'s Books Best Seller list for 121 weeks and was adapted as a feature film of the same name that was released on December 15, 2006.','Fantasy'),(14,'2021-10-27 01:49:34',_binary '\0','2021-10-27 01:49:34','0141036141','George Orwell','Nineteen Eighty-Four',_binary 'data:image/jpeg;base64,','1949-06-04 00:00:00','Secker & Warburg','Table of Contents\nEditor\'s Note\n1. Introduction\n	Harold Bloom\n2. Afterword: Nineteen Eighty-Four in 1984\n	Raymond Williams\n3. Composing Nineteen Eighty-Four: The Art of Nightmare\n	Sue Lonoff\n4. The Demonic World of Oceania: The Mystical Adulation of the \"Sacred\" \n5. Leader\n	Erika Gottlieb\n6. Totalitarianism: A New Story? An Old Story?\n	Laurence Lerner\n7. The Ghostly Bells of London\n	Robert Plank\n8. Newspeak and the Language of the Party\n	Roger Fowler\n9. The Hell of Nineteen Eighty-Four\n	Malcolm Pittock\n10. The Masks of Passion\n	Steven Carter\n11. The Heresy of Common Sense: The Prohibition of Decency in Ninetee Eighty-\nFour\n	Anthony Stewart\n12. Doublespeak and the Minority of One\n	Homi K. Bhabha\nChronology\nContributors\nBibliography\nAcknowledgments\nIndex','political fiction'),(15,'2021-10-27 01:49:54',_binary '\0','2021-10-27 01:49:54','2121234345','Christopher Paolini','Eragon 2',_binary 'data:image/png;base64,','2013-06-20 00:00:00','cbj','Eragon is the first book in The Inheritance Cycle by American fantasy writer Christopher Paolini. Paolini, born in 1983, began writing the novel after graduating from high school at age fifteen.[1] After writing the first draft for a year, Paolini spent a second year rewriting and fleshing out the story and characters. His parents saw the final manuscript and in 2001 decided to self-publish Eragon;[2] Paolini spent a year traveling around the United States promoting the novel. The book was discovered by novelist Carl Hiaasen, who got it re-published by Alfred A. Knopf. The re-published version was released on August 26, 2003.\n\nThe book tells the story of a farm boy named Eragon, who finds a mysterious stone in the mountains. The stone is revealed to be a dragon egg, and a dragon he later names Saphira hatches from it. When the evil King Galbatorix finds out about the egg, he sends monstrous servants to acquire it, making Eragon and Saphira flee from their hometown with a storyteller named Brom. Brom, an old member of an extinct group called the Dragon Riders, teaches Eragon about \'The Ways of the Rider.\'\n\nEragon was the third-best-selling children\'s hardback book of 2003, and the second-best-selling paperback of 2005. It placed on the New York Times Children\'s Books Best Seller list for 121 weeks and was adapted as a feature film of the same name that was released on December 15, 2006.','Fantasy'),(16,'2021-10-27 01:50:49',_binary '\0','2021-10-27 01:50:49','21212343343','Christopher Paolini','Eragon 3',_binary 'data:image/png;base64,','2014-07-24 00:00:00','cbj','Eragon is the first book in The Inheritance Cycle by American fantasy writer Christopher Paolini. Paolini, born in 1983, began writing the novel after graduating from high school at age fifteen.[1] After writing the first draft for a year, Paolini spent a second year rewriting and fleshing out the story and characters. His parents saw the final manuscript and in 2001 decided to self-publish Eragon;[2] Paolini spent a year traveling around the United States promoting the novel. The book was discovered by novelist Carl Hiaasen, who got it re-published by Alfred A. Knopf. The re-published version was released on August 26, 2003.\n\nThe book tells the story of a farm boy named Eragon, who finds a mysterious stone in the mountains. The stone is revealed to be a dragon egg, and a dragon he later names Saphira hatches from it. When the evil King Galbatorix finds out about the egg, he sends monstrous servants to acquire it, making Eragon and Saphira flee from their hometown with a storyteller named Brom. Brom, an old member of an extinct group called the Dragon Riders, teaches Eragon about \'The Ways of the Rider.\'\n\nEragon was the third-best-selling children\'s hardback book of 2003, and the second-best-selling paperback of 2005. It placed on the New York Times Children\'s Books Best Seller list for 121 weeks and was adapted as a feature film of the same name that was released on December 15, 2006.','Fantasy'),(17,'2021-10-27 01:51:35',_binary '\0','2021-10-27 01:51:35','21212313123','Christopher Paolini','Eragon 4',_binary 'data:image/jpeg;base64,','2015-06-12 00:00:00','cbj','Eragon is the first book in The Inheritance Cycle by American fantasy writer Christopher Paolini. Paolini, born in 1983, began writing the novel after graduating from high school at age fifteen.[1] After writing the first draft for a year, Paolini spent a second year rewriting and fleshing out the story and characters. His parents saw the final manuscript and in 2001 decided to self-publish Eragon;[2] Paolini spent a year traveling around the United States promoting the novel. The book was discovered by novelist Carl Hiaasen, who got it re-published by Alfred A. Knopf. The re-published version was released on August 26, 2003.\n\nThe book tells the story of a farm boy named Eragon, who finds a mysterious stone in the mountains. The stone is revealed to be a dragon egg, and a dragon he later names Saphira hatches from it. When the evil King Galbatorix finds out about the egg, he sends monstrous servants to acquire it, making Eragon and Saphira flee from their hometown with a storyteller named Brom. Brom, an old member of an extinct group called the Dragon Riders, teaches Eragon about \'The Ways of the Rider.\'\n\nEragon was the third-best-selling children\'s hardback book of 2003, and the second-best-selling paperback of 2005. It placed on the New York Times Children\'s Books Best Seller list for 121 weeks and was adapted as a feature film of the same name that was released on December 15, 2006.','Fantasy'),(18,'2021-10-27 12:54:40',_binary '\0','2021-10-27 12:54:40','1','William Shakespere','Romeo and Juliet',_binary 'data:image/jpeg;base64,','1597-03-10 10:00:00','British Royal Crown','- Act 1\n- Act 2\n- Act 3\n- Act 4\n- Act 5','Tragedy'),(19,'2021-10-27 12:58:43',_binary '\0','2021-10-27 12:58:43','9781921064579','Kate McCaffrey','Destroying Avalon',_binary 'data:image/jpeg;base64,','2006-06-08 10:00:00','Fremantle Arts Centre Press','- Chapter 1\n- Chapter 2\n- Chapter 3\n- Chapter 4\n- Chapter 5\n- Chapter 6\n- Chapter 7\n- Chapter 8\n- Chapter 9\n','Novel'),(20,'2021-10-27 02:00:05',_binary '\0','2021-10-27 02:00:05','0465026567','Douglas R. Hofstadter','Godel, Escher, Bach: An Eternal Golden Braid',_binary 'data:image/jpeg;base64,','1979-04-01 00:00:00','Basic Books','Part I GEB\nChapter I The MU-puzzle p. 33\nChapter II Meaning and Form in Mathematics p. 46\nChapter III Figure and Ground p. 64\nChapter IV Consistency, Completeness, and Geometry p. 82\nChapter V Recursive Structures and Processes p. 127\nChapter VI The Location of Meaning p. 158\nChapter VII The Propositional Calculus p. 181\nChapter VIII Typographical Number Theory p. 204\nChapter IX Mumon and Godel p. 246\nPart II EGB p. 275\nChapter X Levels of Description, and Computer Systems p. 285\nChapter XI Brains and Thoughts p. 337\nChapter XII Minds and Thoughts p. 369\nChapter XIII BlooP and FlooP and GlooP p. 406\nChapter XIV On Formally Undecidable Propositions of TNT and Related Systems p. 438\nChapter XV Jumping out of the System p. 465\nChapter XVI Self-Ref and Self-Rep p. 495\nChapter XVII Church, Turing, Tarski, and Others p. 559\nChapter XVIII Artificial Intelligence: Retrospects p. 594\nChapter XIX Artificial Intelligence: Prospects p. 641\nChapter XX Strange Loops, Or Tangled Hierarchies p. 684',' Science'),(21,'2021-10-27 02:03:24',_binary '\0','2021-10-27 02:03:24','9780778309468','Brenda Novak','One Perfect Summer',_binary 'data:image/jpeg;base64,','2020-07-04 00:00:00','MIRA Books','From New York Times bestselling author Brenda Novak comes a novel about finding family in unexpected places and the lifelong bonds that don\'t need a lifetime to forge\n\nWhen Serenity Alston swabbed her cheek for 23andMe, she joked about uncovering some dark ancestral scandal. The last thing she expected was to discover two half sisters she didn\'t know existed. Suddenly, everything about her loving family is drawn into question. And meeting these newfound sisters might be the only way to get answers.\n\nSerenity has always found solace at her family\'s Lake Tahoe cabin, so what better place for the three women to dig into the mystery that has shaken the foundation each of them was raised on? With Reagan navigating romantic politics at her New York City advertising firm, and Lorelei staring down the collapse of her marriage, all three women are converging at a crossroads in their lives. Before the summer is over, they\'ll have to confront the paths they walked to get there and determine how to move forward when everything they previously thought to be true was a lie.\n\nBut any future is easier to face with family by your side. ','Contemporary romance'),(22,'2021-10-27 13:04:58',_binary '\0','2021-10-27 13:04:58','978-0385353304','Emily St. John Mandel','Station Eleven',_binary 'data:image/jpeg;base64,','2014-06-19 10:00:00','Penguin Publishing','- Chapter 1\n- Chapter 2\n- Chapter 3\n- Chapter 4\n- Chapter 5\n- Chapter 6\n- Chapter 7\n- Chapter 8\n- Chapter 9\n- Chapter 10\n- Chapter 11','Novel');
INSERT INTO `books` VALUES (23,'2021-10-27 02:09:34',_binary '\0','2021-10-27 02:09:34','9781980279181','Jody Wenner','Imperfect Memories: The Temporal Shift Series, Book 1',_binary 'data:image/jpeg;base64,','2018-02-21 00:00:00','Jody Wenner','hyperthymesia. noun. A condition characterized by a photographic autobiographical memory, wherein the person has an extraordinary capacity to recall specific events in their past.\n\nNina Rogers is different.\nShe can recall every moment of her lifeor at least she could.\nAfter losing her husband and daughter in an unexplained bombing, Nina thinks she might also be losing her mind.\nAs she grieves, her memory continues to deteriorate.\nAnd when they arrest the man responsible for killing her family, Nina becomes convinced she was his intended target.\nThe only way to find out is to meet with him face to face, where she discovers they have something very important and very dangerous in common.','Thriller'),(24,'2021-10-27 02:11:30',_binary '\0','2021-10-27 02:11:30','9781408855652',' J.K. Rowling','Harry Potter and the Philosopher\'s Stone',_binary 'data:image/jpeg;base64,','1996-06-26 00:00:00','Bloomsbury Children\'s Books','1. The Boy Who Lived\n2. The Vanishing Glass\n3. The Letters from No One\n4. The Keeper of the Keys\n5. Diagon Alley\n6. The Journey from Platform Nine and Three-quarters\n7. The Sorting Hat\n8. The Potions Master\n9. The Midnight Duel\n10. Halloween\n11. Quidditch\n12. The Mirror of Erised\n13. Nicolas Flamel\n14. Norbert The Norwegian Ridgeback\n15. The Forbidden Forest\n16. Through the Trapdoor\n17. The Man with Two Faces','Fantasy'),(25,'2021-10-27 02:21:56',_binary '\0','2021-10-27 02:21:56','9780007136599','J. R. R. Tolkien','The Fellowship of the Ring',_binary 'data:image/gif;base64,','1954-07-24 00:00:00','George Allen & Unwin','One Ring to rule them all, One Ring to find them, One Ring to bring them all and in the darkeness bind them\n\nIn ancient times the Rings of Power were crafted by the Elven-smiths, and Sauron, The Dark Lord, forged the One Ring, filling it with his own power so that he could rule all others. But the One Ring was taken from him, and though he sought it throughout Middle-earth, it remained lost to him. After many ages it fell into the hands of Bilbo Baggins, as told in The Hobbit.\n\nIn a sleepy village in the Shire, young Frodo Baggins finds himself faced with an immense task, as his elderly cousin Bilbo entrusts the Ring to his care. Frodo must leave his home and make a perilous journey across Middle-earth to the Cracks of Doom, there to destroy the Ring and foil the Dark Lord in his evil purpose. ','Fantasy'),(26,'2021-10-27 02:22:29',_binary '\0','2021-10-27 02:22:29','9780064404990',' C. S. Lewis','The Lion, the Witch and the Wardrobe',_binary 'data:image/jpeg;base64,','1950-10-16 00:00:00','HarperCollins','Lucy looks into a wardrobe\nWhat Lucy found there\nEdmund and the wardrobe\nTurkish delight\nBack on this side of the door\nInto the forest\nA day with the Beavers\nWhat happened after dinner\nIn the Witch\'s house\nThe spell begins to break\nAslan is nearer\nPeter\'s first battle\nDeep magic from the dawn of time\nThe triumph of the Witch\nDeeper magic from before the dawn of time\nWhat happened about the statues\nThe hunting of the White Stag','Fantasy'),(27,'2021-10-27 02:28:59',_binary '\0','2021-10-27 02:28:59','9780007203598','J.R.R. Tolkien','The Two Towers',_binary 'data:image/jpeg;base64,','1954-11-11 00:00:00','George Allen & Unwin','One Ring to rule them all, One Ring to find them, One Ring to bring them all and in the darkness bind them\n\nFrodo and his Companions of the Ring have been beset by danger during their quest to prevent the Ruling Ring from falling into the hands of the Dark Lord by destroying it in the Cracks of Doom. They have lost the wizard, Gandalf, in a battle in the Mines of Moria. And Boromir, seduced by the power of the Ring, tried to seize it by force. While Frodo and Sam made their escape, the rest of the company was attacked by Orcs. Now they continue the journey alone down the great River Anduinalone, that is, save for the mysterious creeping figure that follows wherever they go.','Fantasy'),(28,'2021-10-27 02:31:26',_binary '\0','2021-10-27 02:31:26','9780007103072','God','The Holy Bible',_binary 'data:image/jpeg;base64,','0001-01-01 00:00:00','God','    Genesis\n    Exodus\n    Leviticus\n    Numbers\n    Deuteronomy\n    Joshua\n    Judges\n    Ruth\n    1 Samuel\n    2 Samuel\n    1 Kings\n    2 Kings\n    1 Chronicles\n    2 Chronicles\n    Ezra\n    Nehemiah\n    Tobit\n    Judith\n    Esther\n    Job\n    Psalms\n    Proverbs\n    Ecclesiastes\n    Song of Solomon\n    Wisdom\n    Sirach (Ecclesiasticus)\n    Isaiah\n    Jeremiah\n    Lamentations\n    Baruch\n    Ezekiel\n    Daniel\n    Hosea\n    Joel\n    Amos\n    Obadiah\n    Jonah\n    Michah\n    Nahum\n    Habbukuk\n    Zephaniah\n    Haggai\n    Zechariah\n    Malachi\n    1 Maccabees\n    2 Maccabees\n    Matthew\n    Mark\n    Luke\n    John\n    Acts of the Apostles\n    Romans\n    1 Corinthians\n    2 Corinthians\n    Galatians\n    Ephesians\n    Colossians\n    1 Thessalonians\n    2 Thessalonians\n    1 Timothy\n    2 Timothy\n    Titus\n    Philemon\n    Hebrews\n    James\n    1 Peter\n    2 Peter\n    1 John\n    2 John\n    3 John\n    Jude\n    Revelation (Apocalypse)\n',' Epistle'),(29,'2021-10-27 02:37:23',_binary '\0','2021-10-27 02:37:23','9788845255427','J.R.R. Tolkien','The Return of the King',_binary 'data:image/gif;base64,','1955-10-20 00:00:00','George Allen & Unwin','In the third volume of The Lord of the Rings trilogy the good and evil forces join battle, and we see that the triumph of good is not absolute. The Third Age of Middle-earth ends, and the age of the dominion of Men begins.','Fantasy'),(30,'2021-10-28 08:01:34',_binary '\0','2021-10-28 08:01:34','1827184','J. R. R. Tolkein','The Hobbit',_binary 'data:image/jpeg;base64,','1937-06-06 00:00:00','George A